import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	intro: {
		display: "flex",
		alignItems: "center",
		margin: "2rem 0",
	},
	info: {
		paddingLeft: "2rem",
	},
	about: {
		lineHeight: "25px",
	},
	profileImg: {
		borderRadius: "50%",
	},
}));
